import{_ as a,a as r,b as o}from"./chunks/pixhack_v5_debug.D1_dDAaI.js";import{_ as l,E as i,c as s,J as n,m as t,a as d,ab as h,o as c}from"./chunks/framework.CUflZczI.js";const T=JSON.parse('{"title":"CUAV v5 (단종)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/cuav_v5.md","filePath":"ko/flight_controller/cuav_v5.md"}'),p={name:"ko/flight_controller/cuav_v5.md"},u=t("h1",{id:"cuav-v5-단종",tabindex:"-1"},[d("CUAV v5 (단종) "),t("a",{class:"header-anchor",href:"#cuav-v5-단종","aria-label":'Permalink to "CUAV v5 (단종)"'},"​")],-1),m=h('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available.</p></div><div class="warning custom-block"><p class="custom-block-title">PX4 does not manufacture this (or any) autopilot. 이 보드는 <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk 프로젝트</a> <strong>FMUv5</strong> 개방형 하드웨어 설계에 기반합니다. <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS에서 PX4를 실행하며, PX4 펌웨어와 호환됩니다.</p><p><em>CUAV v5</em><sup>®</sup> (previously &quot;Pixhack v5&quot;) is an advanced autopilot designed and made by CUAV<sup>®</sup>. The board is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design. It runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS, and is fully compatible with PX4 firmware. It is intended primarily for academic and commercial developers.</p><p><img src="'+a+'" alt="CUAV v5"></p><h2 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h2><ul><li><p>메인 FMU 프로세서: STM32F765</p><ul><li>32 비트 Arm® Cortex®-M7, 216MHz, 2MB 메모리, 512KB RAM</li></ul></li><li><p>IO 프로세서: STM32F100</p><ul><li>32 비트 Arm® Cortex®-M3, 24MHz, 8KB SRAM</li></ul></li><li><p>내장 센서 :</p><ul><li>가속도계/자이로스코프 : ICM-20689</li><li>가속도계/자이로스코프 : BMI055</li><li>자력계 : IST8310</li><li>기압계: MS5611</li></ul></li><li><p>인터페이스:</p><ul><li>PWM 출력 8-14개(IO 6개, FMU 8개)</li><li>FMU의 전용 PWM/캡처 입력 3 개</li><li>CPPM 전용 RC 입력</li><li>PPM 및 S.Bus 전용 RC 입력</li><li>아날로그/PWM RSSI 입력</li><li>PWM Servo 출력</li><li>범용 시리얼 포트 5개</li><li>I2C 포트 4개</li><li>SPI 버스 4개</li><li>2 CANBuses with serial ESC</li><li>배터리 2 개의 전압 및 전류에 대한 아날로그 입력</li></ul></li><li><p>전원 시스템 :</p><ul><li>전원: 4.3~5.4V</li><li>USB 입력: 4.75~5.25V</li><li>서보 전원 입력: 0~36V</li></ul></li><li><p>중량 및 크기:</p><ul><li>중량: 90g</li><li>크기: 44x84x12mm</li></ul></li><li><p>기타 특징:</p><ul><li>작동 온도: -20 ~ 80°c (측정치)</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Order from <a href="https://cuav.taobao.com/index.htm?spm=2013.1.w5002-16371268426.2.411f26d9E18eAz" target="_blank" rel="noreferrer">CUAV</a>.</p><h2 id="연결" tabindex="-1">연결 <a class="header-anchor" href="#연결" aria-label="Permalink to &quot;연결&quot;">​</a></h2><p><img src="'+r+'" alt="CUAV v5"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The RCIN interface is limited to powering the rc receiver and cannot be connected to any power/load. 이 세개의 파워 레일은: <strong>POWER1</strong>, <strong>POWER2</strong> 그리고 <strong>USB</strong> 입니다.</p><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p>:::note 출력 전원 레일인 <strong>FMU PWM OUT</strong>과 <strong>I/O PWM OUT</strong> (0V to 36V) 은 비행제어보드에 전원을 공급하지 않습니다.(공급받지도 않습니다). <strong>POWER1</strong>, <strong>POWER2</strong> 또는 <strong>USB</strong>중 하나에서 전원을 공급하여야 합니다.</p><div class="info custom-block"><p class="custom-block-title">The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div></div></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><strong>POWER1</strong>과 <strong>POWER2</strong> 입력 (4.3V ~ 5.4V)</li><li><strong>USB</strong> 입력 (4.75V ~ 5.25V)</li></ol><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port. Simply connect the FTDI cable to the Debug &amp; F7 SWD connector. To access the I/O Debug port, the user must remove the CUAV v5 shell. Both ports have standard serial pins and can be connected to a standard FTDI cable (3.3V, but 5V tolerant).</p><p>The pinout is as shown.</p><p><img src="'+o+'" alt="CUAV v5 debug"></p><table><thead><tr><th>핀</th><th>CUAV v5 디버그</th></tr></thead><tbody><tr><td>1</td><td>GND</td></tr><tr><td>2</td><td>FMU-SWCLK</td></tr><tr><td>3</td><td>FMU-SWDIO</td></tr><tr><td>4</td><td>UART7_RX</td></tr><tr><td>5</td><td>UART7_TX</td></tr><tr><td>6</td><td>VCC</td></tr></tbody></table><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX는 SBUS_RC 커넥터의 RC 입력입니다.</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>디버깅 콘솔</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>PX4IO</td></tr></tbody></table><h2 id="주변-장치" tabindex="-1">주변 장치 <a class="header-anchor" href="#주변-장치" aria-label="Permalink to &quot;주변 장치&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">디지털 대기속도 센서</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">텔레메트리 라디오 모듈</a></li><li><a href="./../sensor/rangefinders.html">거리계/거리 센서</a></li></ul><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 참조 설계 핀배열</a>.</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5.html" target="_blank" rel="noreferrer">CUAV V5 문서</a></li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a></li></ul>',22);function g(b,f,v,_,P,k){const e=i("Badge");return c(),s("div",null,[u,n(e,{type:"info",text:"Discontinued"}),m])}const A=l(p,[["render",g]]);export{T as __pageData,A as default};
